import fetch from "isomorphic-unfetch";

const Index = props => {
  return (
    <div className="container m-4">
      <p>{props.data}</p>
    </div>
  );
};

Index.getInitialProps = async () => {
  const response = await fetch("http://localhost:5500/api/letter/1");
  const data = await response.json();
  console.log(data);
  return { data: data };
};

export default Index;
